import React from 'react';
import style from './style.module.css'


function Footer() {
    return (
    <div className={style.wrapper}>
<div className={style.navigation}>
    <p>Home</p>
    <p>Textbook</p>
    <p>Statistics</p>
    <p>Sprint</p>
    <p>Alex</p>
    <p>Gabriel</p>
    <p>Marcus</p>
</div>
    </div>
    );
}

export default Footer;
